?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Известнейшая фирма, производящая часы, Girard-Perregaux была открыта в 18 веке, а если быть точнее, в 1791 году. Ее создателем считается Жан Франсуа Батт. Именно с его помощью, казалось бы, небольшая фирма, сумела завоевать доверие потребителей по всему миру. Известность пришла после того, как компания начала выпускать сверхтонкие часы. Поскольку конкуренты еще не изобретали подобных часов, к компании быстро пришел успех. На данный момент компания также удерживает лидерские позиции на часовом рынке. Интересно, что в производстве часов Girard-Perregaux используются, так называемые, золотые мосты, хронографы и репетиры. Все модели часов производятся вручную, и имеют эксклюзивный характер (поскольку производятся в ограниченном количестве). Компания также специализируется на выпуске единичных моделей. Каждую деталь часов, в отличие от многих других часовых фирм, компания производит самостоятельно, начиная со стрелок и заканчивая ремешками. Компания производит как мужские, так и женские коллекции. Мастера сосредотачивают свое внимание на каждой детали часов, которая потом тестируется. Элитные часы Girard-Perregaux предназначены для деловых и уважаемых людей, которые ценят в часах, прежде всего, качество и надежность.</span></span></p>
 
